INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0, 10040, 0.0, 24001, "リン", 1, "あたしだって\nやるときはやるよ！", 0.0, 102601, 24, 1, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (1, 10040, 0.0, 24002, "リン", 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 102601, 24, 1, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (2, 10040, 0.0, 24003, "リン", 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 102601, 24, 1, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (3, 10040, 0.0, 24004, "リン", 2, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 102601, 24, 2, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (4, 10040, 0.0, 24005, "リン", 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 102601, 24, 1, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (5, 10040, 0.0, 24006, "リン", 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 102601, 24, 2, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (6, 10040, 0.0, 24007, "リン", 2, "あたしも意外と\nやるもんでしょ？", 0.0, 102601, 24, 2, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (7, 10040, 0.0, 24008, "リン", 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 102601, 24, 4, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (8, 10040, 0.0, 24009, "リン", 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 102601, 24, 4, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (9, 10040, 0.0, 24010, "リン", 4, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 102601, 24, 4, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10, 10040, 0.0, 24011, "リン", 4, "やられた…\nねずみって意外と\nてごわいね", 0.0, 102601, 24, 4, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (11, 10040, 0.0, 24012, "リン", 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 102601, 24, 4, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (12, 10040, 1.81, 24013, "リン", 1, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 102601, 24, 4, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59");
